import React, { Component, useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import axios from "axios";

const UserProfiles = () => {
  const [userProfiles, setUserProfiles] = useState([]);
  const fetchUsers = () => {
    axios.get("http://localhost:8080/all").then((res) => {
      console.log(res);
      setUserProfiles(res.data);
    });
  };
  useEffect(() => {
    fetchUsers();
  }, []);

  return userProfiles.map((user,index) => {
    return (
      <div key={index}>
        <h3>id: {user.id} - {user.name}</h3>

      </div>
    );
  });
};

const PostUser = () => {
  const [user, setUser] = useState([]);
  const userToPost = {name:"reactuser"};
  const postUser = () => {
    axios.post("http://localhost:8080/add",userToPost).then();
  }
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <UserProfiles />
      </div>
    );
  }
}
export default App;
